import React,{useEffect,useState} from "react";
import {Box,Stack,Button,Typography,TextField} from "@mui/material";
import {exerciseOptions,fetchData} from '../utils/fetchData'

const SerachExercises=()=>{
    const[search,setSearch] =useState('');

    const handlesearch =async()=>{
        if(search){
            const exercisesData =await fetchData();
        }
    }
    return(
        <Stack alignItem='center' mt='10px'
        justifyContent='center' p='20px'>
            <Typography fontWeight={800} sx=
            {{fontsize:{lg:'44px',xs:'30px'}}} mb='50px' textAlign='center'>Awesome Exercises You<br/>Should Know</Typography>
            <Box position='relative' mb='72px'>
                <TextField
                sx={{input:{
                    fontWeight:'700',
                    border:'none',
                    borderRadius:'4px',
                    // position:'absolute',
                    // height:'76px',
                }, width:{lg:'800px',xs:'350px'}}}
                height='76px'
                // alignItems='center'
                // justifyContent='center'
                // textAlign='center'
                value={search}
                placeholder='Search-Exercises'
                onChange={(e)=>setSearch(e.target.value.toLowerCase)}
                type='text'
                />
                <Button className='search-btn'
                sx={{
                    color:'#fff',
                    bgcolor:'#ff2625',
                    textTransform:'none',
                    width:{lg:'175px',xs:'80px'},
                    fontSize:{lg:'20px',xs:'10px'},
                    height:'56px',
                    position:'absolute',
                    right:'470px',
                }}
                onClick={handlesearch}>Search</Button>
            </Box>
        </Stack>
    )
}

export default SerachExercises;
